import React from 'react'
//import logo
import Logo from "../img/Logo.png"

const NavBar = () => {
  return (
    <div className='navbar'>
        <div className="container">
            <div className="logo">
                <img src={Logo} alt="" />
            </div>
            <div className="links">links</div>
        </div>
    </div>
  )
}

export default NavBar
